import zhLocale from 'element-ui/lib/locale/lang/zh-CN'
const zh = {
  message: {
    'logout': '退出',
    'login_welcome': '欢迎来到玩创Lab',
    'username_input': '    输入用户名',
    'password_input': '    输入密码',
    'fullscreen': '全屏',
    'login_btn': '登 录',
    'expired_time': '过期时间',
    'version': '版本号：',
    'back_btn': '返回'
  },
  errors: {
    'user_expired': '您的账号已过期',
    'wrong_password': '您输入的用户名或者密码不正确'
  },
  ...zhLocale
}
export default zh
